package ManishLokesh.Neptune.v1.GetOrderFromIRCTC.RequestBody;import java.util.List;public class AggregatorDetails {    private Long id;    private String name;    private List<String> customerCareNumbers;    private Long outletId;    private String outletName;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public List<String> getCustomerCareNumbers() {        return customerCareNumbers;    }    public void setCustomerCareNumbers(List<String> customerCareNumbers) {        this.customerCareNumbers = customerCareNumbers;    }    public Long getOutletId() {        return outletId;    }    public void setOutletId(Long outletId) {        this.outletId = outletId;    }    public String getOutletName() {        return outletName;    }    public void setOutletName(String outletName) {        this.outletName = outletName;    }}